Вот функция Swift, которая сортирует массив целых чисел и выводит отсортированный массив на экран:

```swift
import Foundation

// Функция для сортировки массива целых чисел
func sortAndPrintArray(array: [Int]) {
    // Сортируем массив
    let sortedArray = array.sorted()

    // Выводим отсортированный массив на экран
    print(sortedArray)
}

// Пример использования
let myArray = [5, 3, 8, 1, 4, 9, 7, 6, 2]
sortAndPrintArray(array: myArray)
```

Эта функция использует метод `sorted()` для сортировки массива в порядке возрастания. Затем она выводит отсортированный массив на экран с помощью функции `print()`. Вы можете заменить массив `myArray` на любой массив целых чисел, которые вы хотите отсортировать и вывести.

A continuación se muestra un ejemplo de código para ESP32 que utiliza el sensor de temperatura DS18B20 junto con la biblioteca OneWire y la biblioteca DallasTemperature para leer la temperatura de los sensores. El código también muestra la temperatura en el monitor serial.

Primero, asegúrate de tener las siguientes bibliotecas en tu archivo `setup.py`:

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

// Definir el pin donde está conectado el bus OneWire
#define ONE_WIRE_BUS 22

// Crear una instancia de la clase DallasTemperature
OneWire oneWire(ONE_WIRE_BUS);
DallasTemperature sensors(&oneWire);

void setup(void) {
  Serial.begin(115200);
  sensors.begin();
  Serial.println("Iniciando lectura de temperatura...");
}

void loop(void) {
  // Lectura de la temperatura de todos los sensores DS18B20
  sensors.requestTemperatures(); 
  Serial.print("Temperaturas de los sensores DS18B20:");

  // Recorrer todos los sensores y mostrar la temperatura
  for (int i=0; i<sensors.getDeviceCount(); i++) {
    Serial.print("Sensor ");
    Serial.print(i);
    Serial.print(": ");
    Serial.print(sensors.getTempCByIndex(i));
    Serial.println();
  }

  delay(2000); // Esperar 2 segundos antes de la próxima lectura
}
```

En este código, el pin `22` se utiliza como el pin del bus OneWire para el sensor DS18B20. Debes cambiar el valor de `ONE_WIRE_BUS` si tu configuración es diferente.

El código inicializa el monitor serial y el sensor DS18B20 en la función `setup()`. En la función `loop()`, solicita las temperaturas de todos los sensores DS18B20 y luego recorre cada sensor para mostrar su dirección (indice) y temperatura en el monitor serial.

Recuerda instalar las bibliotecas necesarias para tu proyecto ESP32:

1. Instala la biblioteca ESP-IDF (Instrucción de Desarrollo para ESP32) si aún no lo has hecho.
2. Añade las bibliotecas `OneWire` y `DallasTemperature` a tu proyecto:
   - En el directorio `components` de tu proyecto, crea una carpeta llamada `drivers` y copia los archivos `DallasTemperature.cpp` y `DallasTemperature.h` en esa carpeta.
   - Añade las siguientes líneas a tu archivo `CMakeLists.txt` o `setup.py`:

```makefile
include_directories(/path/to/drivers/DallasTemperature)

target_sources(tu_proyecto PRIVATE
  /path/to/drivers/DallasTemperature/DallasTemperature.cpp
)
```

Reemplaza `/path/to/` con la ruta real a las carpetas `drivers` y `DallasTemperature.cpp` en tu proyecto.

Una vez que hayas configurado todo, puedes compilar y ejecutar tu proyecto en el ESP32. La temperatura de los sensores DS18B20 se mostrará en el monitor serial cada 2 segundos.

A continuación se muestra un ejemplo de implementación del algoritmo de ordenación por burbuja en C. El algoritmo de ordenación por burbuja compara elementos adyacentes y los intercambia si están en el orden incorrecto. Este proceso se repite hasta que el array esté completamente ordenado.

```c
#include <stdio.h>

// Función para realizar ordenación por burbuja
void bubbleSort(int arr[], int n) {
    int i, j, temp;

    // Pasar a través de todos los elementos del array
    for (i = 0; i < n-1; i++) {

        // Pasar a través del array desde el primer elemento hasta el (n-i-1)
        for (j = 0; j < n-i-1; j++) {

            // Si el elemento actual es mayor que el siguiente elemento
            if (arr[j] > arr[j+1]) {
                // Intercambiar los elementos
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

// Función principal para probar la función de ordenación
int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);

    printf("Array antes de ordenar:\n");
    for (int i = 0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");

    // Llamar a la función de ordenación
    bubbleSort(arr, n);

    printf("Array después de ordenar:\n");
    for (int i = 0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");

    return 0;
}
```

Este programa define una función `bubbleSort` que toma un array de enteros y su tamaño como argumentos. Ordena el array usando el algoritmo de ordenación por burbuja y luego imprime el array antes y después de la ordenación.

Recuerda que el algoritmo de ordenación por burbuja tiene una complejidad temporal de O(n^2) en el peor de los casos, lo que lo hace ineficiente para arrays grandes. Sin embargo, es simple de entender y implementar, lo que lo hace adecuado para arrays pequeños o como ejemplo educativo.

Para escribir la fórmula de Bhaskara, que es una fórmula para resolver la ecuación de segundo grado (ax^2 + bx + c = 0), en LaTeX, puedes usar el siguiente código:

```latex
x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}
```

Este código LaTeX producirá la fórmula de Bhaskara para los valores de x en una ecuación de segundo grado. Recuerda incluir el prefijo `\frac{}` para fracciones y el símbolo de raíz cuadrada `\sqrt{}` para la raíz cuadrada. Aquí tienes cómo puedes incluirlo en un documento LaTeX:

```latex
\documentclass{article}
\usepackage{amsmath} % Para comandos avanzados de matemáticas

\begin{document}

La fórmula de Bhaskara para resolver la ecuación de segundo grado $ax^2 + bx + c = 0$ es:
\begin{equation}
x = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}
\end{equation}

\end{document}
```

Este código LaTeX incluirá la fórmula de Bhaskara en un documento con el prefijo `equation`, que generalmente se numera automáticamente por el compilador LaTeX. Si necesitas más personalización o tienes preguntas adicionales, no dudes en preguntar.

To create a Discord bot with a slash command using Discord.js v14, you'll need to follow these steps:

1. Set up your project and install the necessary packages.
2. Create a new file for your bot (e.g., `bot.js`).
3. Set up the bot with a command handler for the slash command.
4. Implement the logic for the ban command.
5. Run the bot with your bot token.

Here's a basic example of how you could implement this:

```javascript
// bot.js

const {
  Client,
  Intents,
  Collection,
  SlashCommandBuilder
} = require('discord.js');
const { prefix, token } = require('./config.json'); // Make sure to create a config.json with your token

const client = new Client({ intents: [Intents.FLAGS.GUILDS, Intents.FLAGS.GUILD_MESSAGES] });

// Collection to store commands
const commands = new Collection();

// Slash command builder
const builder = new SlashCommandBuilder()
  .setName('ban')
  .setDescription('Bans a user from the server')
  .addUserOption((option) =>
    option
      .setName('user')
      .setDescription('The user to ban')
  );

// Ban command logic
async function banCommand(interaction) {
  const { user } = interaction.options.getUser('user');

  if (!user) {
    return interaction.reply({ content: 'Please specify a user to ban.', ephemeral: true });
  }

  try {
    const guild = interaction.guild;
    const member = guild.members.cache.get(user.id);

    if (!member) {
      return interaction.reply({ content: 'User not found.', ephemeral: true });
    }

    if (member.user.bot) {
      return interaction.reply({ content: 'Cannot ban a bot.', ephemeral: true });
    }

    const reason = interaction.options.getString('reason');

    await member.ban({ reason: reason });

    interaction.reply({ content: `${member.user.tag} has been banned.`, ephemeral: true });
  } catch (error) {
    console.error(error);
    interaction.reply({ content: 'Failed to ban the user.', ephemeral: true });
  }
}

// Register the command
commands.set('ban', banCommand);

// Event listener for slash commands
client.application.commands.set(commands);

// Log in to Discord
client.login(token);
```

Make sure you have a `config.json` file with your bot token:

```json
{
  "token": "YOUR_BOT_TOKEN"
}
```

Replace `"YOUR_BOT_TOKEN"` with your actual bot token.

This code sets up a Discord bot with a slash command `/ban` that allows a user to ban another user from the server. The bot checks if the target user exists, is not a bot, and then bans them with an optional reason.

Before running the bot, make sure you have the `discord.js` library installed:

```bash
npm install discord.js
```

And don't forget to enable the necessary intents in the Discord developer portal for your bot to access guilds and messages.

To run the bot, execute:

```bash
node bot.js
```

