Here's a JavaScript function that takes an array of 5 numbers, checks each number to see if it's a prime number, and prints the prime numbers to the console:

```javascript
function isPrime(num) {
  if (num <= 1) return false;
  if (num <= 3) return true;

  if (num % 2 === 0 || num % 3 === 0) return false;

  for (let i = 5; i * i <= num; i += 6) {
    if (num % i === 0 || num % (i + 2) === 0) return false;
  }

  return true;
}

function checkPrimeNumbers(numbersArray) {
  if (numbersArray.length !== 5) {
    console.error('The input array must contain exactly 5 numbers.');
    return;
  }

  numbersArray.forEach(number => {
    if (isPrime(number)) {
      console.log(number);
    }
  });
}

// Example usage:
const numbers = [3, 4, 7, 11, 13];
checkPrimeNumbers(numbers);
```

This function `checkPrimeNumbers` first checks if the input array has exactly 5 elements. If not, it logs an error message to the console. Then, it iterates over each number in the array, uses the `isPrime` helper function to check if the number is prime, and prints the prime numbers to the console.

The `isPrime` function implements a basic primality test that checks divisibility by 2 and 3, then checks for factors in the form of 6k ± 1 up to the square root of the number. This is an efficient way to check for primality for larger numbers.

You can test this function with different arrays of 5 numbers to see which ones are prime.
